import React from 'react';
import 'animate.css';

const TestAnimation = () => {
  return (
    <div className="animated rollOut" style={{ animationDelay: '0.5s' }}>
      <h1>This is a test for zoomIn animation</h1>
    </div>
  );
};

export default TestAnimation;
